print("%table")
e = open("/data/epoch_results.csv", "r")

epoch_totals = {}
epoch_correct = {}

for line in e:
    parts = line.split("\t")

    epoch = parts[0]

    if epoch == "epoch":
        continue

    if not epoch in epoch_totals:
        epoch_totals[epoch] = 0
        epoch_correct[epoch] = 0

    correct = parts[3].strip()

    epoch_totals[epoch] = epoch_totals[epoch] + 1

    if correct == "1":
        epoch_correct[epoch] = epoch_correct[epoch] + 1

print("Epoch\tTotal\tRight\tPercent")
for k in epoch_totals:
    print(k + "\t" + str(epoch_totals[k]) + "\t" + str(epoch_correct[k]) + "\t" + str( epoch_correct[k] / epoch_totals[k]))

e.close()
